Ironijos kupinas kvietimas „Garso ir šviesų bus tiek, kad jų nebeliks niekam kitam, todėl šie koncertai bus iš viso paskutiniai visame pasaulyje. Po to tiesiog nieko niekur niekada nebevyks, įskaitant sporto, cirko, gaidžių peštynes, „Game of Thrones“ ir kitas pramogas. Taip jau netikėtai sutapo, jog šiais metais švenčiu dvigubą jubiliejų — man keturiasdešimt šešeri ir esu dvidešimt keturis metus scenoje, todėl koncertai bus šventiški ir kvepės blyškia žilagalvio gaiva“, – prieš koncertus juokavo Marijonas. „Reikalinga techninė aparatūra bus atgabenta dviem traukiniais, lėktuvnešiu ir trimis karavanais kupranugarių, kuriuos valdys geriausi Azijos raiteliai. Visa tai aptarnaus penki šimtai vergų iš Somalio, prižiūrimi  Anglijos karalienės . Nežinau, kodėl, bet ji pati pasiprašė. Nuo stogo, kaip visuose normaliuose Lietuvos koncertuose, nusileis kaskadininkas angelo rūbais. Kiek kartų – neaišku, bet kiekvieną kart stengsis tarsi paskutinį. Iš darbo už sukčiavimą atleista striptizo šokėja jodinės ant Bengalijos tigro. Ji bus su boružėlės apdaru, todėl reginys bus patrauklus ir vaikams. Koncertų pabaigoje mane paskelbs karaliumi, po ko pasiversiu į robotą ir susideginsiu ant laužo“, – tokiais išgalvotais pažadais dalijosi Marijonas, pakvietęs savo gerbėjus grandiozinius koncertus didžiuosiuose Lietuvos miestuose. Antrąją Kalėdų dieną Kaune šou surengęs Marijonas priešpaskutinį metų vakarą ant scenos stojo Vilniuje. Tiesa, kviesdamas į koncertus Marijonas juokavo, kad jei niekas neateis – jam baigsis blogai, nes paimta paskola. Tačiau minia Vilniuje viršijo visus lūkesčius – net prasidėjus koncertui dauguma žiūrovų stovėjo kamščiuose arba eilėse patekti į areną. Pradžia priminė repeticiją „Šiek tiek  myžčioju , čia gal kaip savam mieste. Žinau, kad teks paskui čia vaikščioti, tai kad nenuvilčiau, – į minią kreipėsi scenoje pasirodęs Marijonas. – Čia mes išėjome lengvai prasidainuoti, nors kaip kažkada sakė Juozas Erlickas: „Nesuprantu dainininkų, kurie prieš dainavimą prasidainuoja. Aš prieš gerdamas tai neprasigeriu“. Bet mes ne Juozas.“ Išties koncerto pradžia labiau priminė repeticiją – Marijonas su komanda stovėjo scenoje, kurią gaubė prietema, šviesa vis dar švietė besirenkantiems žiūrovams, o jie dainas vieną po kito dainavo vos po kelias eilutes. Po keliolika minučių trukusio prasidainavimo Marijonas dar kartą pasisveikino su publika, tarė „pradedam“ ir areną apgaubė tamsa, įsižiebė šviesos scenoje. Po kelių dainų M. Mikutavičius vėl kreipėsi į tūkstančius gerbėjų. „Ar galime sakyti, kad nupirktos visos dovanos ir maistas Naujiems metams? Žinot, net jei kažko ir neradot, visiškai nesvarbu, nes Jūsų Nauji metai ir taip bus žiauriai geri. Vertinkime šią dieną ir akimriką, kai esam kartu. Chebra, ši diena yra viena iš gražiausių“, – publikos plojimais palydėtus žodžius tarė Marijonas ir pradėjo dainą „Tu čia, tu čia“. Didžiulis dėmesys publikai „Ar čia yra žmonių, kurie grįžo iš kelionių ir buvo pakeliui namo kurį laiką? O ar yra žmonių, kurie nežino, ką reikia daryti šios dainos viduryje? Chebra, dainos viduryje mes nusirenginėjame, tada mus uždraudžia ir mes iki Kalėdų nebekoncertuojame“, – publikos juoką sukėlė Marijonas ir prasidėjo daina „Pakeliui namo“. Šios dainos metu Marijonas tiek bendravo su publika, prašė jų kartoti viduryje dainos skambantį žodį „užsisėdėjom“, tuomet kvietė stotis, šokinėti, tūptis ir kitaip reaguoti į jo prašymus, jog linksmybių įaudrinta arena atsidėkojo audringais aplodismentais ir akivaizdžiai pasisėmė geros energijos likusiam koncertui. Tai įrodė kita daina. Vos suskambus dainos „Nebetyli sirgaliai“ akordams, visa arena pradėjo ploti ir dainuoti kiekvieną dainos žodį. Publika taip įsijautė dainuodami šią dainą kartu su Marijonu, jog jai pasibaigus Marijonas šūktelėjo publikai, ar „norit pastaugt?“ ir dar kelis kartus sudainavo priedainį tiesiog be muzikos. Beje, prieš dainą „Pakeliui namo“ gerbėjų išsirengti prašęs Marijonas to iš publikos nesulaukė, tačiau pamažu pradėjo pats mažinti ant savęs turėtų aksesarų bei drabužių kiekį. Pirmoji žemėn krito skrybėlė, kiek vėliau įkaitęs atlikėjas nusirėngė ir liemenę. (function(d, s, i, r) {
